It's that time. We have lined up another great must attend @startuphealth showcase. This time, we will be featuring companies from our @chcfnews cohort. These companies all are underrepresented founders who have lived experience with the problem they are trying to solve and whose businesses have applicability in the #Medicaid market, in turn helping those who need it the most.

Come and meet Jade Kearney of She Matters Inc who is on a mission to help #blackmothers have better outcomes;

Hear how Katherine Steinberg is leading the charge on ending #loneliness through her work with Determined Health;

Discover the work of Justin Ayers who is leveling the playing field for the #LGBTQ+ population by increasing access to care with equalityMD;

Explore what Cindy Blanco Ochoa and MiSalud Health are doing to enhance #healthcare for the #LatinX population; and finally

Learn how SageSurfer and Gaytri Khandelwal are pioneering new models of #mental and #behavioral #health through their omni-channel model.

Request your invite at: startuphealth.com/showcase

This is your chance to be a part of our community of health transformers and meet the companies making a real impact in healthcare today and creating a better future for all of us!

